import React from 'react';
import { Link } from 'react-router-dom';

const profilesData = [
  { id: 1, name: 'Alice', age: 25, occupation: 'Engineer' },
  { id: 2, name: 'Bob', age: 30, occupation: 'Designer' },
  { id: 3, name: 'Charlie', age: 35, occupation: 'Developer' },
  { id: 4, name: 'David', age: 40, occupation: 'Artist' },
  { id: 5, name: 'Eve', age: 45, occupation: 'Musician' },
];

function Profiles() {
  return (
    <div>
      <h1>Profiles</h1>
      <ul>
        {profilesData.map(profile => (
          <li key={profile.id}>
            <Link to={`/profile/${profile.id}`}>{profile.name}</Link>
          </li>
        ))}
      </ul>
    </div>
  );
}

export default Profiles;
